import { Icon } from '@iconify/react';
import plusFill from '@iconify/icons-eva/plus-fill';
import { Link as RouterLink } from 'react-router-dom';
// material
import { Grid, Button, Container, Stack, Typography, Slider } from '@mui/material';
// components
import Page from '../components/Page';
//

// ----------------------------------------------------------------------

const marks = [
  {
    value: 0,
    label: '0%'
  },
  {
    value: 20,
    label: '20%'
  },
  {
    value: 40,
    label: '40%'
  },
  {
    value: 60,
    label: '60%'
  },
  {
    value: 80,
    label: '80%'
  },
  {
    value: 100,
    label: '100%'
  }
];

// ----------------------------------------------------------------------

export default function Settings() {
  return (
    <Page title="Dashboard: Settings">
      <Container maxWidth="xl">
        <Stack direction="row" alignItems="center" justifyContent="space-between" mb={5}>
          <Typography variant="h4" gutterBottom style={{ color: '#66fcf1' }}>
            Settings
          </Typography>
        </Stack>
        <Container maxWidth="xl">
          <Grid
            container
            spacing={{ xs: 1, sm: 2, lg: 3 }}
            columns={{ xs: 8, sm: 8, md: 8, lg: 8 }}
          >
            <Grid item xs={1} sm={1} md={2}>
              <Typography variant="h6" gutterBottom style={{ color: '#45a29e' }}>
                Robot Seed
              </Typography>
              <Slider defaultValue={50} step={10} min={0} max={100} marks={marks} color="red" />
            </Grid>
          </Grid>
        </Container>
      </Container>
    </Page>
  );
}
